// import libaries
import React, { Component } from 'react';

// import components
import Home from './components/Home';


class App extends Component {

  constructor(){
    super();
    this.state = {
      user: 'Josefine'
    };
  }

  render(){
    return (
      <Home user = {this.state.user} /> 
    );
  }
}

export default App;
